import React from 'react'
import { Link } from 'react-router-dom'

const ProvideRoute = () => {
  return (
    <div className="">
      <div></div>
        <Link to = '/signup'>Sign Up</Link>
        <Link to = '/login' >Login</Link>
      <div/>
    </div>
  )
}

export default ProvideRoute
